(2, 2, 1, 10, '2021-06-02', '2021-06-02', '2021/0002', 'approved', 'Assalamu Alaikum, \r\n\r\nDear Sir,\r\n\r\nAs you might have already know, I need to assemble the remaining  tasks that are left for the final presentation of my thesis term. The presentation will held on this 3rd June  and I will need a day off on 2nd June for all obvious perspectives. \r\n\r\nTherefore, please allow me a day off  on 2nd June (night shift of 1st June) and keep me in your deep prayers for successful submission of all the elements of the overall thesis program.\r\n\r\nYours faithfully,\r\nAfsana Afrin', 'Good Luck', '2021-05-31 21:17:09', '2021-06-01 03:31:01'),
(3, 2, 1, 11, '2021-06-11', '2021-06-11', '2021/0003', 'approved', 'I want to go Rangpur for attending my friend\'s weeding, so I need a casual leave for 11th June 2021. Please allow my leave application for that day.', 'Approved.', '2021-06-08 17:21:17', '2021-06-09 16:17:54');
